import React from 'react';
import styled from 'styled-components';

const Content = () => {
  return (
    <Container>
      <Banner />
    </Container>
  );
};

export default Content;

const Container = styled.div`
  max-width: 1200px;
  width: 90%;
  margin: 0 auto;

  padding-top: 60px;
`;
const Banner = styled.div`
  height: 100px;
  background-image: url(https://rerollcdn.com/update/set-7-update-bg.png);
`;
